export const sliderStyles = {
    container: {
      width: '100%',
      margin: '20px 0',
    },
    track: {
      background: '#ddd',
      height: '5px',
      borderRadius: '5px',
    },
    thumb: {
      height: '20px',
      width: '20px',
      backgroundColor: '#4CAF50',
      borderRadius: '50%',
      cursor: 'pointer',
    },
    rangeValues: {
      display: 'flex',
      justifyContent: 'space-between',
      fontSize: '14px',
      marginTop: '5px',
    },
  };
